import React from 'react'
import { NavLink } from 'react-router-dom'
function Header() {
  return (
    <div className="container" style={{
        backgroundColor: '#99c2f2',
    }}>
    <header className="d-flex flex-wrap justify-content-center border-bottom">
      <NavLink to="/admin" className="d-flex align-items-center mb-3 mb-md-0 me-md-auto text-dark text-decoration-none">
        <span className="fs-4">RECIPES</span>
      </NavLink>

      <ul className="nav">
        <li className="nav-item"><NavLink to="/admin" className="nav-link active" aria-current="page">Recipe</NavLink></li>
      </ul> 
    </header>
  </div>
  )
}

export default Header
